from typing import List
class Solution:
    def openLock(self, deadends: List[str], target: str) -> int:
        seen=set()
        item="0000"
        deadends=set(deadends)
        if item in deadends: return -1
        count=0
        q=[(item,count)]
        seen.add(item)

        while q:
            item,count=q.pop(0)

            if item==target:    return count
            for pos in range(4):
                # Incrementing
                if int(item[pos])<9:    value=str(int(item[pos])+1)
                else:   value='0'
                seq=item[:pos]+value+item[pos+1:]
                if seq not in deadends and seq not in seen: 
                    q.append((seq,count+1))
                    seen.add(seq)
                # Decrementing
                if int(item[pos])>0:    value=str(int(item[pos])-1)
                else: value='9'
                seq=item[:pos]+value+item[pos+1:]
                if seq not in deadends and seq not in seen: 
                    q.append((seq,count+1))
                    seen.add(seq)
        return -1


